import React, {Component} from 'react';
import {Button, Form} from "react-bootstrap";
import axios from 'axios';


class PozycjaCud extends Component {
    constructor(props) {
        super(props);
        this.state = {
            adres : [],
            stan : [],
            poz :{}
        };
    }
    componentDidMount() {
        axios({
            method: 'get',
            url: `http://localhost:8081/mag/${this.props.id}`,
        }).then((response) => {
            this.setState({mag: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
        axios({
            method: 'get',
            url: `http://localhost:8081/adres/all`,
        }).then((response) => {
            this.setState({adres: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });

        axios({
            method: 'get',
            url: `http://localhost:8081/stanmag/all`,
        }).then((response) => {
            this.setState({stan: response.data})
            console.log(response.data)

        }).catch((error) => {
            console.log(error)
        });
    }
    render() {
        return (
            <div>
                {this.props.typ}
            </div>
        );
    }
}

export default PozycjaCud;
